def dispatch_to_series(left, right, func, str_rep=None, axis=None):
    """
    Evaluate the frame operation func(left, right) by evaluating
    column-by-column, dispatching to the Series implementation.

    Parameters
    ----------
    left : DataFrame
    right : scalar or DataFrame
    func : arithmetic or comparison operator
    str_rep : str or None, default None
    axis : {None, 0, 1, "index", "columns"}

    Returns
    -------
    DataFrame
    """

    def column_op(a, b):
        if isinstance(b, pd.Series) and pd.api.types.is_timedelta64_dtype(b):
            result = {i: _possibly_cast_op(a.iloc[:, i], b, func) for i in range(a.shape[1])}
        else:
            result = {i: func(a.iloc[:, i], b) for i in range(a.shape[1])}
        return result

    new_data = left.apply(lambda x: column_op(x, right), axis=1, result_type='expand')
    return new_data
